(12, 'Don?t control us', 'Siddharth Basrur', 'Jeene ke hain sau wajah<br>Le har maza tu ho ho ho<br>Khone ko saara jahaan<br>Ab daud jaa tu ho ho ho..<br>Aaj hi hai kal tera le faisla tu<br>Bandishon ko to tod jaa tu<br>Saansen Chala tu ho ho ho?<br><br>Roke hain na jaane kyun ye<br>Toke hain na jaane kyun ye<br>Karte hain na jaane kyun sawaal<br>Mere hain ye saare sapne<br>Band aankhon ke mere apne<br>Ghar mein ye karte hain kyun ye bawaal<br>Kyun na ye jaane hu pe na chalegi marzi<br>Zamaane humse?Zamaane se hum nahi<br>Don?t control us?Don?t control us?<br>Don?t control us?Don?t control us?<br><br>Hai khula ye jahaan chal chalaa..<br>Rok naa..naa re<br>Manchala hai chalaa?Bah gaya..<br>Yun tok naa?naa re.<br>Thokaron se dar nahi hai, Jaante sambhalna<br>Mushkilon ki roz leke jaan pe nikalna<br>Karegi Saari duniyaa salaam<br>Kyun na ye jaane?Hum pe naa chalegi marzi<br>Zamaane humse?Zamaane se hum nahi<br>Don?t control us?Don?t control us?<br>Don?t control us?Don?t control us?<br><br>Jaanun Main na jaane tu Kya hoga fir abhi<br>Par jeene ka hai maza Jab jiyo Zindagi<br>Maane tu na Maanu main Koi philosphy<br>Par apni strategy samjhe koi bhi nahi<br>Tune suna, Maine kaha? Zor chadha?Zor badha..<br>Kyun na ye jaane?Hum pe naa chalegi marzi<br>Zamaane humse?Zamaane se hum nahi<br>Don?t control us?Don?t control us?<br>Don?t control us?Don?t control us?', NULL),
